function fearNotLetter(str) {
  let letters = "";
  let currCode = 0;
  let nextCode = 0;
  letters = str.toLowerCase();
  for(let i = 0; i < str.length; i++){
    currCode = str.charCodeAt(i);
    nextCode = str.charCodeAt(i + 1);
    if(currCode === 122) {
      return undefined;
    }
    if(nextCode !== currCode + 1) {
      return String.fromCharCode(currCode + 1);
    }
  }

}

